tables.table_schema:
CREATE TABLE AccessControlSystem (
    id INT PRIMARY KEY,
    user_id INT,
    biometric_data VARCHAR(255),
    access_level INT
);

CREATE TABLE User (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) UNIQUE,
    password VARCHAR(100),
    biometric_data BYTEA
);

CREATE TABLE AccessLevel (
    level_id SERIAL PRIMARY KEY,
    level_name VARCHAR(50) UNIQUE
);

CREATE TABLE UserAccess (
    access_id SERIAL PRIMARY KEY,
    user_id UUID REFERENCES User(user_id),
    level_id INT REFERENCES AccessLevel(level_id)
);

CREATE TABLE access_logs (
  log_id INT PRIMARY KEY,
  user_id INT,
  access_time TIMESTAMP,
  access_type VARCHAR(10)
);

CREATE TABLE users (
  user_id INT PRIMARY KEY,
  username VARCHAR(50) UNIQUE,
  password VARCHAR(50),
  fingerprint_data BYTEA
);

CREATE TABLE access_levels (
  level_id INT PRIMARY KEY,
  level_name VARCHAR(50)
);

CREATE TABLE user_access (
  user_id INT,
  level_id INT,
  FOREIGN KEY (user_id) REFERENCES users(user_id),
  FOREIGN KEY (level_id) REFERENCES access_levels(level_id)
);
